import{_ as a,c as e,o as t,a as s}from"./app.2c9d185c.js";const u='{"title":"\u041B\u043E\u0433\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u0417\u0430\u0434\u0430\u0447\u0430","slug":"\u0437\u0430\u0434\u0430\u0447\u0430"},{"level":2,"title":"ELK","slug":"elk"}],"relativePath":"elk/intro.md","lastUpdated":1637070759904}',r={},i=s('<h1 id="\u043B\u043E\u0433\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435" tabindex="-1">\u041B\u043E\u0433\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435 <a class="header-anchor" href="#\u043B\u043E\u0433\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435" aria-hidden="true">#</a></h1><h2 id="\u0437\u0430\u0434\u0430\u0447\u0430" tabindex="-1">\u0417\u0430\u0434\u0430\u0447\u0430 <a class="header-anchor" href="#\u0437\u0430\u0434\u0430\u0447\u0430" aria-hidden="true">#</a></h2><p>\u0422\u0430\u043A \u043A\u0430\u043A \u043D\u0430\u0448\u0438 \u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u044F \u0440\u0430\u0431\u043E\u0442\u0430\u044E\u0442 \u043D\u0430 \u043C\u043D\u043E\u0436\u0435\u0441\u0442\u0432\u0435 \u043C\u0430\u0448\u0438\u043D, \u0445\u043E\u0434\u0438\u0442\u044C \u043D\u0430 \u043A\u0430\u0436\u0434\u044B\u0439 \u0441\u0435\u0440\u0432\u0435\u0440 \u0438 \u0441\u043C\u043E\u0442\u0440\u0435\u0442\u044C/\u0441\u043E\u0431\u0438\u0440\u0430\u0442\u044C \u043B\u043E\u0433\u0438, \u0433\u0434\u0435 \u043A\u0430\u0436\u0434\u044B\u0439 \u0444\u0430\u0439\u043B \u043C\u043E\u0436\u0435\u0442 \u0441\u043F\u043E\u043A\u043E\u0439\u043D\u043E \u0434\u043E\u0441\u0442\u0438\u0433\u0430\u0442\u044C \u0433\u0438\u0433\u0430\u0431\u0430\u0439\u0442\u043E\u0432, \u043D\u0435 \u043E\u0447\u0435\u043D\u044C \u0442\u043E \u0443\u0434\u043E\u0431\u043D\u043E. \u041E\u0442\u0441\u044E\u0434\u0430 \u0435\u0441\u0442\u044C \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u043E\u0441\u0442\u044C \u0441\u043E\u0431\u0438\u0440\u0430\u0442\u044C \u0434\u0430\u043D\u043D\u044B\u0435 \u0433\u0434\u0435-\u0442\u043E \u0432 \u0435\u0434\u0438\u043D\u043E\u0439 \u0442\u043E\u0447\u043A\u0435 \u0432\u0445\u043E\u0434\u0430, \u0438 \u0438\u043C\u0435\u0442\u044C \u0434\u043B\u044F \u044D\u0442\u043E\u0433\u043E \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0430\u043D\u0430\u043B\u0438\u0437\u0430 \u0434\u0430\u043D\u043D\u044B\u0445 \u043F\u043E\u043B\u0443\u0447\u0448\u0435 \u043A\u043E\u043D\u0441\u043E\u043B\u044C\u043D\u044B\u0445 grep, awk, less \u0438 \u043F\u0440\u043E\u0447\u0435\u0435.</p><h2 id="elk" tabindex="-1">ELK <a class="header-anchor" href="#elk" aria-hidden="true">#</a></h2><p>\u0414\u043B\u044F \u0437\u0430\u0434\u0430\u0447 \u043B\u043E\u0433\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F \u043C\u044B \u0431\u0443\u0434\u0435\u043C \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C \u0441\u0442\u0435\u043A ELK, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0440\u0430\u0441\u0448\u0438\u0444\u0440\u043E\u0432\u044B\u0432\u0430\u0435\u0442\u0441\u044F \u043A\u0430\u043A Elasticsearch, Logstash, Kibana. \u0412 \u043D\u0430\u0448\u0435\u043C \u0441\u043B\u0443\u0447\u0430\u0435 \u044D\u0442\u043E \u043D\u0435 \u0441\u043E\u0432\u0441\u0435\u043C \u0442\u043E\u0447\u043D\u043E, \u0442\u0430\u043A \u043A\u0430\u043A \u043E\u0434\u0438\u043D \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442 \u0441\u0438\u043C\u0442\u0435\u043C\u044B \u043C\u044B \u0437\u0430\u043C\u0435\u043D\u0438\u043C \u043D\u0430 \u0434\u0440\u0443\u0433\u043E\u0439 (\u043F\u043E\u043F\u0440\u043E\u0449\u0435).</p><ul><li><strong>Elasticsearch</strong> - \u0440\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u0430\u044F \u0441\u0438\u0441\u0442\u0435\u043C\u0430 \u043F\u043E\u0438\u0441\u043A\u0430 \u0438 \u0430\u043D\u0430\u043B\u0438\u0437\u0430 \u0434\u0430\u043D\u043D\u044B\u0445 - \u044F\u0434\u0440\u043E \u0441\u0442\u0435\u043A\u0430, \u0445\u0440\u0430\u043D\u0438\u0442 \u043B\u043E\u0433\u0438 \u0432 \u0444\u043E\u0440\u043C\u0430\u0442\u0435, \u0443\u0434\u043E\u0431\u043D\u043E\u043C \u0434\u043B\u044F \u043F\u043E\u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0435\u0439 \u0440\u0430\u0431\u043E\u0442\u044B (\u0441 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u0435\u043C \u0438\u043D\u0434\u0435\u043A\u0441\u043E\u0432 \u0438 \u043F\u0440\u043E\u0447\u0438\u0445 \u0445\u0438\u0442\u0440\u044B\u0445 \u0448\u0442\u0443\u043A). \u042D\u043B\u0430\u0441\u0442\u0438\u043A \u043C\u043E\u0436\u0435\u0442 \u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C \u043A\u0430\u043A \u043A\u043B\u0430\u0441\u0442\u0435\u0440 \u043C\u0430\u0448\u0438\u043D, \u0438 \u043E\u0431\u0440\u0430\u0431\u0430\u0442\u044B\u0432\u0430\u0442\u044C \u043F\u0435\u0442\u0430\u0431\u0430\u0439\u0442\u044B \u0434\u0430\u043D\u043D\u044B\u0445.</li><li><strong>Kibana</strong> - \u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0438\u043D\u0442\u0435\u0440\u0444\u0435\u0439\u0441 \u0434\u043B\u044F \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u044F elasticsearch, \u0441 \u043D\u0438\u043C \u043A\u0430\u043A \u0440\u0430\u0437 \u0438 \u0432\u0437\u0430\u0438\u043C\u043E\u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044E\u0442 \u043B\u044E\u0434\u0438 \u043F\u0440\u0438 \u0440\u0430\u0431\u043E\u0442\u0435 \u0441\u043E \u0441\u0442\u0435\u043A\u043E\u043C. \u0414\u0430\u0435\u0442 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u044B \u0434\u043B\u044F \u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u044F, \u0432\u0438\u0437\u0443\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u0438 \u043C\u043E\u043D\u0438\u0442\u043E\u0440\u0438\u043D\u0433\u0430 \u0441\u0438\u0441\u0442\u0435\u043C.</li><li><strong>Logstash</strong> - \u0441\u0438\u0441\u0442\u0435\u043C\u0430 \u0434\u043B\u044F \u0441\u0431\u043E\u0440\u0430 \u0438 \u043F\u0440\u0435\u0434\u0432\u0430\u0440\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0439 \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u043A\u0438 \u043B\u043E\u0433\u043E\u0432. \u0412 \u0441\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u043D\u043E\u0439 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0435 \u0434\u0430\u043D\u043D\u044B\u0435, \u043F\u0440\u0435\u0436\u0434\u0435 \u0447\u0435\u043C \u043F\u043E\u043F\u0430\u0441\u0442\u044C \u0432 \u044D\u043B\u0430\u0441\u0442\u0438\u043A, \u0434\u043E\u043F\u043E\u043B\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u043E\u0431\u0440\u0430\u0431\u0430\u0442\u044B\u0432\u0430\u044E\u0442\u0441\u044F/\u043F\u0430\u0440\u0441\u044F\u0442\u0441\u044F \u0432 \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u043F\u0440\u0430\u0432\u0438\u043B\u0430\u043C\u0438, \u0442.\u0435. Logstash \u0432 \u0434\u0430\u043D\u043D\u043E\u043C \u0441\u043B\u0443\u0447\u0430\u0435 \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u043F\u0440\u043E\u0441\u043B\u043E\u0439\u043A\u043E\u0439 \u043C\u0435\u0436\u0434\u0443 \u0441\u0438\u0441\u0442\u0435\u043C\u043E\u0439 \u0445\u0440\u0430\u043D\u0435\u043D\u0438\u044F \u0438 \u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u044F\u043C\u0438. \u0412 \u043D\u0430\u0448\u0435\u0439 \u0441\u0438\u0441\u0442\u0435\u043C\u0435 \u043C\u044B \u0431\u0443\u0434\u0435\u043C \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C \u0431\u043E\u043B\u0435\u0435 \u043F\u0440\u043E\u0441\u0442\u043E\u0439 \u0441\u043F\u043E\u0441\u043E\u0431 \u0441\u043E\u0431\u0438\u0440\u0430\u0442\u044C \u043B\u043E\u0433\u0438 (\u0441\u043C. \u043D\u0438\u0436\u0435)</li><li><strong>Beats</strong> - \u043B\u0435\u0433\u043A\u043E\u0432\u0435\u0441\u043D\u044B\u0435 \u0430\u0433\u0435\u043D\u0442\u044B, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u0435\u0442 \u043E\u0442\u043F\u0440\u0430\u0432\u043B\u044F\u0442\u044C \u043B\u043E\u0433\u0438 \u043D\u0430\u043F\u0440\u044F\u043C\u0443\u044E \u0432 elasticsearch. \u041E\u043D\u0438 \u0441\u0442\u0430\u0432\u044F\u0442\u0441\u044F \u0440\u044F\u0434\u043E\u043C \u0441 \u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u044F\u043C\u0438, \u0437\u0430\u043D\u0438\u043C\u0430\u044E\u0442 \u043D\u0435\u043C\u043D\u043E\u0433\u043E \u0440\u0435\u0441\u0443\u0440\u0441\u043E\u0432, \u0438\u0445-\u0442\u043E \u043C\u044B \u0438 \u0431\u0443\u0434\u0435\u043C \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C.</li></ul>',6),l=[i];function n(o,c,h,d,_,p){return t(),e("div",null,l)}var f=a(r,[["render",n]]);export{u as __pageData,f as default};
